When a type is declared as an auto trait, we will automatically create impls for every struct/enum/union, unless an explicit impl is provided. These automatic impls contain a where clause for each field of the form T: AutoTrait, where T is the type of the field and AutoTrait is the auto trait in question. As an example, consider the struct List and the auto trait Send: struct List<T> { data: T, next: Option<Box<List<T>>>,
} Presuming that there is no explicit impl of Send for List, the compiler will supply an automatic impl of the form: struct List<T> { data: T, next: Option<Box<List<T>>>,
} unsafe impl<T> Send for List<T>
where T: Send, // from the field `data` Option<Box<List<T>>>: Send, // from the field `next`
{ } Explicit impls may be either positive or negative. They take the form: impl<...> AutoTrait for StructName<..> { }
impl<...> !AutoTrait for StructName<..> { }

