The tracking issue for this feature is: None. The rustc compiler has certain pluggable operations, that is, functionality that isn't hard-coded into the language, but is implemented in libraries, with a special marker to tell the compiler it exists. The marker is the attribute #[lang = "..."] and there are various different values of ..., i.e. various different 'lang items'. For example, Box pointers require two lang items, one for allocation and one for deallocation. A freestanding program that uses the Box sugar for dynamic allocations via malloc and free: #![feature(lang_items, start, libc, core_intrinsics, rustc_private, rustc_attrs)]
#![no_std]
use core::intrinsics;
use core::panic::PanicInfo;
use core::ptr::NonNull; extern crate libc; struct Unique<T>(NonNull<T>); #[lang = "owned_box"]
pub struct Box<T>(Unique<T>); impl<T> Box<T> { pub fn new(x: T) -> Self { #[rustc_box] Box::new(x) }
} #[lang = "exchange_malloc"]
unsafe fn allocate(size: usize, _align: usize) -> *mut u8 { let p = libc::malloc(size as libc::size_t) as *mut u8; // Check if `malloc` failed: if p as usize == 0 { intrinsics::abort(); } p
} #[lang = "box_free"]
unsafe fn box_free<T: ?Sized>(ptr: *mut T) { libc::free(ptr as *mut libc::c_void)
} #[start]
fn main(_argc: isize, _argv: *const *const u8) -> isize { let _x = Box::new(1); 0
} #[lang = "eh_personality"] extern fn rust_eh_personality() {}
#[lang = "panic_impl"] extern fn rust_begin_panic(_info: &PanicInfo) -> ! { intrinsics::abort() }
#[no_mangle] pub extern fn rust_eh_register_frames () {}
#[no_mangle] pub extern fn rust_eh_unregister_frames () {} Note the use of abort: the exchange_malloc lang item is assumed to return a valid pointer, and so needs to do the check internally. Other features provided by lang items include: overloadable operators via traits: the traits corresponding to the ==, <, dereferencing (*) and + (etc.) operators are all marked with lang items; those specific four are eq, ord, deref, and add respectively. stack unwinding and general failure; the eh_personality, panic and panic_bounds_check lang items. the traits in std::marker used to indicate types of various kinds; lang items send, sync and copy. the marker types and variance indicators found in std::marker; lang items covariant_type, contravariant_lifetime, etc. Lang items are loaded lazily by the compiler; e.g. if one never uses Box then there is no need to define functions for exchange_malloc and box_free. rustc will emit an error when an item is needed but not found in the current crate or any that it depends on. Most lang items are defined by libcore, but if you're trying to build an executable without the standard library, you'll run into the need for lang items. The rest of this page focuses on this use-case, even though lang items are a bit broader than that.

