The tracking issue for this feature is: #38788 When emitting PTX code, all vanilla Rust functions (fn) get translated to "device" functions. These functions are not callable from the host via the CUDA API so a crate with only device functions is not too useful! OTOH, "global" functions can be called by the host; you can think of them as the real public API of your crate. To produce a global function use the "ptx-kernel" ABI. #![feature(abi_ptx)]
#![no_std] pub unsafe extern "ptx-kernel" fn global_function() { device_function();
} pub fn device_function() { // ..
